import React from 'react'
import './Whatperiod.css'
import Feature from '../../component/features/Feature';
const Whatperiod = () => {
  return (
    <div>
      <div className="period__whatperiod section__margin" id="wp">
        <div className="period__period-feature">
          <Feature />
        </div>
      </div>
    </div>
  )
}

export default Whatperiod
